import { useState, useEffect } from "react";
import { makeStyles, withStyles } from "@material-ui/core/styles";
import AppBar from "@material-ui/core/AppBar";
import Toolbar from "@material-ui/core/Toolbar";
import Typography from "@material-ui/core/Typography";
import Avatar from "@material-ui/core/Avatar";
import Container from "@material-ui/core/Container";
import React from "react";
import Card from "@material-ui/core/Card";
import CardContent from "@material-ui/core/CardContent";
import {
  Paper,
  CardActionArea,
  CardMedia,
  Grid,
  TableContainer,
  Table,
  TableBody,
  TableHead,
  TableRow,         
  TableCell,
  Button,
  CircularProgress,
} from "@material-ui/core";
import cblogo from "./cblogo.PNG";
import image from "./bg.png";
import { DropzoneArea } from "material-ui-dropzone";
import { common } from "@material-ui/core/colors";
import Clear from "@material-ui/icons/Clear";

const ColorButton = withStyles((theme) => ({
  root: {
    color: theme.palette.getContrastText(common.black),
    backgroundColor: "#212121",
    "&:hover": {
      backgroundColor: "#333333",
    },
  },
}))(Button);

const axios = require("axios").default;

const useStyles = makeStyles((theme) => ({
  grow: {
    flexGrow: 1,
  },
  clearButton: {
    width: "100%",
    borderRadius: "12px",
    padding: "15px 20px",
    color: "#ffffff",
    fontSize: "18px",
    fontWeight: 700,
    backgroundColor: "#333333",
    "&:hover": {
      backgroundColor: "#555555",
    },
  },
  root: {
    maxWidth: 400,
    flexGrow: 1,
    backgroundColor: "transparent",
  },
  media: {
    height: 350,
    borderRadius: "10px",
    transition: "transform 0.3s ease-in-out",
    "&:hover": {
      transform: "scale(1.02)",
    },
  },
  paper: {
    padding: theme.spacing(2),
    margin: "auto",
    maxWidth: 600,
    backgroundColor: "transparent",
  },
  gridContainer: {
    justifyContent: "center",
  },
  mainContainer: {
    backgroundImage: `url(${image})`,
    backgroundRepeat: "no-repeat",
    backgroundPosition: "center",
    backgroundSize: "cover",
    height: `calc(100vh - 64px)`,
    backgroundColor: `#f5f5f5`,
  },
  imageCard: {
    margin: "auto",
    width: 400,
    height: 500,
    backgroundColor: "transparent",
    boxShadow: "0px 9px 30px 0px rgba(0, 0, 0, 0.2) !important",
    borderRadius: "12px",
  },
  imageCardEmpty: {
    height: "auto",
  },
  noImage: {
    margin: "auto",
    width: 400,
    height: "400px",
  },
  input: {
    display: "none",
  },
  tableContainer: {
    backgroundColor: "transparent !important",
    boxShadow: "none !important",
  },
  table: {
    backgroundColor: "transparent !important",
  },
  tableCell: {
    fontSize: "20px",
    backgroundColor: "transparent !important",
    borderColor: "transparent !important",
    color: "#333333",
    fontWeight: 600,
    padding: "10px 20px",
  },
  text: {
    color: "#333333 !important",
    textAlign: "center",
  },
  buttonGrid: {
    maxWidth: "400px",
    width: "100%",
  },
  detail: {
    backgroundColor: "rgba(255, 255, 255, 0.9)",
    display: "flex",
    justifyContent: "center",
    flexDirection: "column",
    alignItems: "center",
    padding: "20px",
    borderRadius: "10px",
  },
  appbar: {
    background: "linear-gradient(90deg, #007BFF, #6610f2)",
    boxShadow: "none",
    color: "white",
  },
  loader: {
    color: "#007BFF !important",
  },
}));

const Home = () => {
  const classes = useStyles();
  const [selectedFile, setSelectedFile] = useState();
  const [preview, setPreview] = useState();
  const [data, setData] = useState();
  const [image, setImage] = useState(false);
  const [isLoading, setIsloading] = useState(false);
  let confidence = 0;

  const sendFile = async () => {
    if (image) {
      let formData = new FormData();
      formData.append("file", selectedFile);
      let res = await axios({
        method: "post",
        url: 'https://api-production-0a11.up.railway.app/predict',
        // url: process.env.REACT_APP_API_URL,
        data: formData,
      });
      if (res.status === 200) {
        setData(res.data);
      }
      setIsloading(false);
    }
  };

  const clearData = () => {
    setData(null);
    setImage(false);
    setSelectedFile(null);
    setPreview(null);
  };

  useEffect(() => {
    if (!selectedFile) {
      setPreview(undefined);
      return;
    }
    const objectUrl = URL.createObjectURL(selectedFile);
    setPreview(objectUrl);
  }, [selectedFile]);

  useEffect(() => {
    if (!preview) {
      return;
    }
    setIsloading(true);
    sendFile();
  }, [preview]);

  const onSelectFile = (files) => {
    if (!files || files.length === 0) {
      setSelectedFile(undefined);
      setImage(false);
      setData(undefined);
      return;
    }
    setSelectedFile(files[0]);
    setData(undefined);
    setImage(true);
  };

  if (data) {
    confidence = (parseFloat(data.confidence) * 100).toFixed(2);
  }

  return (
    <React.Fragment>
      <AppBar position="static" className={classes.appbar}>
        <Toolbar>
          <Typography className={classes.title} variant="h6" noWrap>
            KSRR: Tomato Disease Classification
          </Typography>
          <div className={classes.grow} />
          <Avatar src={cblogo}></Avatar>
        </Toolbar>
      </AppBar>
      <Container
        maxWidth={false}
        className={classes.mainContainer}
        disableGutters={true}
      >
        <Grid
          className={classes.gridContainer}
          container
          direction="row"
          justifyContent="center"
          alignItems="center"
        >
          <Grid item xs={12} style={{ transform: `scale(0.8)`, display: `flex`, flexFlow: `column`, alignItems: `center`, width: `400px` }}>
            <Card className={`${classes.imageCard} ${!image ? classes.imageCardEmpty : ""}`}>
              {image && (
                <CardActionArea>
                  <CardMedia
                    className={classes.media}
                    image={preview}
                    component="img"
                    title="Uploaded Image"
                  />
                </CardActionArea>
              )}
              {!image && (
                <CardContent className={classes.content}>
                  <DropzoneArea
                    acceptedFiles={["image/*"]}
                    dropzoneText={"Drag and drop an image of a tomato plant leaf to process"}
                    onChange={onSelectFile}
                    dropzoneClass={classes.dropzone}
                    showAlerts={false}
                  />
                </CardContent>
              )}
              {data && (
                <CardContent className={classes.detail}>
                  <TableContainer component={Paper} className={classes.tableContainer}>
                    <Table className={classes.table} size="small" aria-label="simple table">
                      <TableHead>
                        <TableRow>
                          <TableCell className={classes.tableCell}>Label:</TableCell>
                          <TableCell align="right" className={classes.tableCell}>Confidence:</TableCell>
                        </TableRow>
                      </TableHead>
                      <TableBody>
                        <TableRow>
                          <TableCell component="th" scope="row" className={classes.tableCell}>
                            {data.class}
                          </TableCell>
                          <TableCell align="right" className={classes.tableCell}>
                            {confidence}%
                          </TableCell>
                        </TableRow>
                      </TableBody>
                    </Table>
                  </TableContainer>
                </CardContent>
              )}
              {isLoading && (
                <CardContent className={classes.detail}>
                  <CircularProgress color="secondary" className={classes.loader} />
                  <Typography className={classes.title} variant="h6" noWrap>
                    Processing...
                  </Typography>
                </CardContent>
              )}
            </Card>
            {data && (
              <Grid container className={classes.buttonGrid}>
                <Grid item xs={12}>
                  <ColorButton
                    startIcon={<Clear />}
                    onClick={clearData}
                    className={classes.clearButton}
                  >
                    Clear Data
                  </ColorButton>
                </Grid>
              </Grid>
            )}
          </Grid>
        </Grid>
      </Container>
    </React.Fragment>
  );
};

export default Home;
